import React from "react";
import { Link } from "react-router-dom";
import { ContentHeader, PortfolioData } from "config/C4";

const PortfolioFilter = () => {
  return (
    <div className="portfolioView__filter">
      <h1>Filter</h1>
    </div>
  );
};

const PortfolioView = () => {
  return (
    <div className="portfolioView">
      <ContentHeader title="Portfolio" />
      <PortfolioFilter />
      <div className="portfolioView__items">
        {PortfolioData &&
          PortfolioData.map((item, i) => (
            <Link
              to={`/portfolio-item/${item.slug}`}
              className="portfolioView__items--item"
              key={i}
            >
              <img
                src={
                  require(`../../assets/images/portfolio/${item.slug}-thumb.jpg`)
                    .default
                }
                alt={item.name}
              />
            </Link>
          ))}
      </div>
    </div>
  );
};

export default PortfolioView;
